selector_to_html = {"a[href=\"vmd/ffmpeg.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">ffmpeg<a class=\"headerlink\" href=\"#ffmpeg\" title=\"Permalink to this heading\">#</a></h1><p><a class=\"reference external\" href=\"https://ffmpeg.org\">ffmpeg Download</a></p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">ffmpeg</span></code> can convert image files to a video. Download the program, and add this to your <code class=\"docutils literal notranslate\"><span class=\"pre\">~/Programs</span></code> folder.</p>", "a[href=\"linux.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">List of Commands<a class=\"headerlink\" href=\"#list-of-commands\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"ssh/config.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Configure <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a><a class=\"headerlink\" href=\"#configure-ssh\" title=\"Permalink to this heading\">#</a></h1><p>The <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a> program receives its configuration from either the command line or from configuration files <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.ssh/config</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">/etc/ssh/ssh_config</span></code>. Command-line options take precedence over configuration files. The user-specific configuration file <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.ssh/config</span></code> is used next. Finally, the global <code class=\"docutils literal notranslate\"><span class=\"pre\">/etc/ssh/ssh_config</span></code> file is used.</p><p>Some commonly used configuration options:</p>", "a[href=\"python/python.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Overview<a class=\"headerlink\" href=\"#overview\" title=\"Permalink to this heading\">#</a></h1><h2>Primitive Datatypes and Operators<a class=\"headerlink\" href=\"#primitive-datatypes-and-operators\" title=\"Permalink to this heading\">#</a></h2><p>You have numbers</p>", "a[href=\"conda/condaambertools.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ambertools Environment<a class=\"headerlink\" href=\"#ambertools-environment\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"Jargon.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Jargon<a class=\"headerlink\" href=\"#jargon\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"bash/vi.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Text Editing with Vi/Vim<a class=\"headerlink\" href=\"#text-editing-with-vi-vim\" title=\"Permalink to this heading\">#</a></h1><p>Vi/Vim is a text editor you can use in your terminal. Unfortunately, this program isn\u2019t like the ones you may be familiar with like Notepad, TextEdit, etc\u2026 There are a lot of key bindings you will need to remember, but once you\u2019re use to it, you\u2019ll realize this text editor designed for speed and increased productivity. The numerous keybindings will be your best friend for speedy navigation to specific points in the file, and for fast editing.</p>", "a[href=\"conda/myenv.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">My recommended Conda Setup<a class=\"headerlink\" href=\"#my-recommended-conda-setup\" title=\"Permalink to this heading\">#</a></h1><h2>My List<a class=\"headerlink\" href=\"#my-list\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"ssh/autologin.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Automate <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a> Login<a class=\"headerlink\" href=\"#automate-ssh-login\" title=\"Permalink to this heading\">#</a></h1><p>Having to enter your password every time you log into a supercomputer and transfer files can become tedious. However, we can log into a supercomputer without the need to enter your password (<em>safely and securely</em>)!</p><p>To do this, we will make a <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a> key. This key is an access credential for the <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a> network protocol. This authenticated and encrypted secure network protocol is used for remote communication between machines on an unsecured open network. <a class=\"reference internal\" href=\"linux.html#term-ssh\"><span class=\"xref std std-term\">ssh</span></a> uses a pair of keys to initiate a secure handshake between the remote parties.</p>", "a[href=\"conda/condaenv.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Conda Environments<a class=\"headerlink\" href=\"#conda-environments\" title=\"Permalink to this heading\">#</a></h1><h2>Creating New Environments<a class=\"headerlink\" href=\"#creating-new-environments\" title=\"Permalink to this heading\">#</a></h2><p>A new conda environment can be created with <code class=\"docutils literal notranslate\"><span class=\"pre\">create</span></code>, and you can specifiy the version of python!</p>", "a[href=\"conda/installconda.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Installing Miniforge<a class=\"headerlink\" href=\"#installing-miniforge\" title=\"Permalink to this heading\">#</a></h1><p>I use miniforge, so this tutorial will guide you through installing <a class=\"reference external\" href=\"https://github.com/conda-forge/miniforge\">Miniforge</a>.</p><p>In the repository:</p>", "a[href=\"bash/startup.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Start Up Files<a class=\"headerlink\" href=\"#start-up-files\" title=\"Permalink to this heading\">#</a></h1><p>When <code class=\"docutils literal notranslate\"><span class=\"pre\">bash</span></code> is invoked as an interactive login shell, or as a non-interactive shell with the \u2013login option, it first reads and executes commands from the file <code class=\"docutils literal notranslate\"><span class=\"pre\">/etc/profile</span></code>, if that file exists. After reading that file, it looks for <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.bash_profile</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.bash_login</span></code>, and <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.profile</span></code>, in that order, and reads and executes commands from the first one that exists and is readable. The \u2013noprofile option may be used when the shell is started to inhibit this behavior.</p><p>When an interactive shell that is not a login shell is started, <code class=\"docutils literal notranslate\"><span class=\"pre\">bash</span></code> reads and executes commands from <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.bashrc</span></code>, if that file exists. This may be inhibited by using the \u2013norc option. The \u2013rcfile file option will force <code class=\"docutils literal notranslate\"><span class=\"pre\">bash</span></code> to read and execute commands from file instead of <code class=\"docutils literal notranslate\"><span class=\"pre\">~/.bashrc</span></code>.</p>", "a[href=\"conda/jupyter.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Jupyter Notebooks<a class=\"headerlink\" href=\"#jupyter-notebooks\" title=\"Permalink to this heading\">#</a></h1><p>The Jupyter Notebook App is a server-client application that allows editing and running notebook documents via a web browser. The Jupyter Notebook App can be executed on a local desktop requiring no internet access (as described in this document) or can be installed on a remote server and accessed through the internet.</p><p>In addition to displaying/editing/running notebook documents, the Jupyter Notebook App has a \u201cDashboard\u201d (Notebook Dashboard), a \u201ccontrol panel\u201d showing local files and allowing to open notebook documents or shutting down their kernels.</p>", "a[href=\"simulation/amberinstall.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Compiling Amber<a class=\"headerlink\" href=\"#compiling-amber\" title=\"Permalink to this heading\">#</a></h1><p>Amber + QMhub + Torchmd-net</p><p>Compile Amber for QM/MM simulations with QMhub and Torchmd-net.</p>", "a[href=\"bash/bash1.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scripting<a class=\"headerlink\" href=\"#scripting\" title=\"Permalink to this heading\">#</a></h1><h2>Redirect Commands<a class=\"headerlink\" href=\"#redirect-commands\" title=\"Permalink to this heading\">#</a></h2><p>You can redirect command input and output (stdin, stdout, and stderr) using \u201credirection operators\u201d. Unlike a pipe, which passes output to a command, a redirection operator has a command\u2019s input come from a file or stream, or sends its output to a file or stream.</p><p>Read from stdin until <code class=\"docutils literal notranslate\"><span class=\"pre\">^EOF$</span></code> and overwrite <a class=\"reference external\" href=\"http://hello.py\">hello.py</a> with the lines between <code class=\"docutils literal notranslate\"><span class=\"pre\">EOF</span></code> (which are called a \u201chere document\u201d):</p>", "a[href=\"conda/condaintel.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Intel Environments on M1/M2<a class=\"headerlink\" href=\"#intel-environments-on-m1-m2\" title=\"Permalink to this heading\">#</a></h1><p>If you have an Macbook with the m1 or m2 chips, you might have found out some python libraries don\u2019t work.</p><p>A work around, is via a conda environment with an intel architecture!</p>", "a[href=\"conda/jupyterbook.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Create Websites<a class=\"headerlink\" href=\"#create-websites\" title=\"Permalink to this heading\">#</a></h1><p>Requires a GitHub account.</p>", "a[href=\"#resources\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Resources<a class=\"headerlink\" href=\"#resources\" title=\"Permalink to this heading\">#</a></h1><p>Additional guides, notes/examples, and tips for an improved QOL (quality of life) in this cubicle.</p>", "a[href=\"bash/basics.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bash Basics<a class=\"headerlink\" href=\"#bash-basics\" title=\"Permalink to this heading\">#</a></h1><p>First line of the script is the shebang which tells the system how to execute the script:</p><p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Shebang_(Unix)\">Shebang</a></p>", "a[href=\"git/branch.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Branching<a class=\"headerlink\" href=\"#branching\" title=\"Permalink to this heading\">#</a></h1><p>List all branches in repository</p>", "a[href=\"chimera/ChimeraX.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction to ChimeraX<a class=\"headerlink\" href=\"#introduction-to-chimerax\" title=\"Permalink to this heading\">#</a></h1><p>Chimera and <a class=\"reference external\" href=\"https://www.cgl.ucsf.edu/chimerax/\">ChimeraX</a> are both great molecular visualization tools developed by UCSF.</p><p>ChimeraX is the newest program, and it can efficiently handle large data (i.e. PDBs with thousands of atoms). It is my prefered GUI when exploring new structures and making videos/figures.</p>", "a[href=\"git/git.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">git<a class=\"headerlink\" href=\"#git\" title=\"Permalink to this heading\">#</a></h1><p><code class=\"docutils literal notranslate\"><span class=\"pre\">git</span></code> is a version control system.\n<code class=\"docutils literal notranslate\"><span class=\"pre\">git</span></code> helps you keep track of code changes.\n<code class=\"docutils literal notranslate\"><span class=\"pre\">git</span></code> is used to collaborate on code.</p><p><a class=\"reference external\" href=\"https://github.com\">GitHub</a> is a cloud-based hosting service that lets you manage <code class=\"docutils literal notranslate\"><span class=\"pre\">git</span></code> repositories. If you have open-source projects that use <code class=\"docutils literal notranslate\"><span class=\"pre\">git</span></code>, then GitHub is designed to help you better manage them.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
